import React from 'react';
import styled from 'styled-components';


const Styles = styled.div`
    background-color: red;
    height: 250px;
    width: 270px;
    margin: 0 auto;
`;

const CustomImage = styled.div`
    background-color: blue;
    height: 160px;
    width: 270px;
`;


export const NewsThumbnail = () => {
    return (
        <Styles>
            <CustomImage>

            </CustomImage>
        </Styles>
    );
}
